selection: >-
    (jet_tightId==1) & (jet_no<2) & (fj_pt>200) & (fj_pt<5000) & (fj_sdmass>0) & (fj_sdmass<650) & (ak.num(cpfcandlt_px) + ak.num(npfcand_px) > 0) &
    (
      ((fj_label >= 309) & (fj_label < 314) & (sample_isQCD==1) & (event_no%7!=0)) |
      (sample_isQCD==0)
    )
